  false,\n\t\"url\": null,\n\t\"notes\": \"This is dervied from land use/land cover
  digital data collected by USGS and coverted to ARC/INFO by the EPA. This data is
  useful for environmental assessment of land use patterns with respect to water quality
  analysis, growth management, and other types of environmental impact assessment.
  Use may be limited due to currency. Land use and land cover data (LU/LC) collected
  by USGS NMD is useful for environmental assessment of land use patterns with respect
  to water quality analysis, growth management, and other types of environmental impact
  assessment. Data are meant to be used by quadrangle, or among adjacent quadrangles
  where temporarily contiguous. Can be used in any geographic application where intermediate
  scale land use data are appropriate and the dates are representative.\",\n\t\"license_title\":
